				&lt;p class=&quot;p&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;
				Mon travail st une tentative d’assembler différentes unités élémentaires, voir organique, matériel, et d’en analyser les résultats de ces opérations les assemblages, le et sa constitution. C’est dans cet objet que mon travail s’effectue. L’objet finie et uniquement un lieu où est projeté l’intégralité de mes questions, c’est un lieu, un alibi qui me permet de confronter mes capacité physique et intellectuel, et d’en effectuer une auto-évaluation. La cristallisation de différentes formes plastique est utilisée sous forme de Benchmark qui permet de créer des points de repère chronologie et, ou des balises mémorielles à vocation de poser une structure et d’établir un apprentissage et de s’élever et de gérer sa connaissance et son énergie spirituelle&lt;/div&gt;
